      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col1 * col1 NOT BETWEEN + col0 * - + 70 * + col2 * + col0 AND - 64 / + 65;
  - name: tab1

outputs:
